Hmm, didn't have success reproducing this with this app that creates 10 windows and toggle the dev tools on them using a shortcut.

```js
const {app, BrowserWindow, globalShortcut, webContents} = require('electron')

let windows = []

app.once('ready', () => {
  for (var i = 0; i < 10; i++) {
    let window = new BrowserWindow()
    window.loadURL('about:blank')
    windows.push(window)
  }

  globalShortcut.register('Command+U', () => {
    webContents.getAllWebContents().forEach((contents) => {
      if (contents.isDestroyed()) return
      if (contents.getType() === 'remote') return

      if (contents.isDevToolsOpened())
        contents.closeDevTools()
      else
        contents.openDevTools()
    })
  })
})
